import logo from './logo.svg';
import './App.css';


function Print(){
  return(
    <h1>hello world</h1>
  );
}

function UserCard() {
  const user = {
    name: "Alice Dupont",
    age: 28,
    job: "Développeuse Web",
    location: "Paris, France"
  };

  return (
    <div className="result">
      <p>Nom : {user.name}</p>
      <p>Age : {user.age}</p>
      <p>Job : {user.job}</p>
      <p>Location : {user.location}</p>
    </div>
  );
}





function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Print />
        <UserCard />
      </header>
    </div>
  );
}


export default App;
